s\". Then build the 4th Building from the top. </br> When you have energy, you can begin to build mines. Go to buildings on the menu and build a metal mine, followed by a crystal mine. </br></br>In order to be able to build ships you need to have a shipyard. To see what is needed to unlock that building you can take a look at \"Technologies\" at the left menu.</br>If you more questions you can look at the beginnersguide, our forum or open a support ticket. </br></br> The team wishes you much fun exploring the universe!',0,1,NULL),(1174,423,1,1640587433,1,'Administrator','Willkommen','Willkommen bei pr0game! Baue zuerst ein Solarkraftwerk, denn Energie wird für die spätere Rohstoffproduktion benötigt. Um diese zu bauen, klicke links im Menu auf \"Gebäude\". Danach baue das 4. Gebäude von oben. Da du nun Energie hast, kannst du anfangen Minen zu bauen. Gehe dazu wieder im Menü auf Gebäude und baue eine Metallmine, danach wieder eine Kristallmine. Um Schiffe bauen zu können musst du zuerst eine Raumschiffswerft gebaut haben. Was dafür benötigt wird findest du links im Menüpunkt Technologie. Das Team wünscht dir viel Spaß beim Erkunden des Universums!',0,1,NULL),(1175,346,0,1640587764,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet Hauptplanet <a href=\"?page=buildings&amp;cp=346&amp;re=0\">[1:344:3]</a> nicht über genügend Ressourcen, um mit dem Bau von Solarkraftwerk zu beginnen. <br>Sie verfügen über 74 Metall , 220 Kristall und 0 Deuterium. <br>Die Baukosten betragen 380 Metall , 152 Kristall und 0 Deuterium.',0,1,NULL),(1176,421,0,1640587861,99,'Bauliste','Bau nicht möglich','Sie verfügen auf Planet Hauptplanet <a href=\"?page=buildings&amp;cp=421&amp;re=0\">[2:19:7]</a> nicht über genügend Ressourcen, um mit dem Bau von Solarkraftwerk zu beginnen. <br>Sie verfügen über 102 Metall , 361 Kristall und 0 Deuterium. <br>Die Baukosten betragen 112 Metall , 45 Kristall und 0 Deuterium.',0,1,NULL),(1177,424,1,1640588014,1,'Administrator','Welcome','Welcome to p